import React from 'react';
import { Tabs } from 'antd';
import { HomeOutlined, DashboardOutlined, HeartOutlined, FormOutlined, UserOutlined } from '@ant-design/icons';
import '../../Styles/PrincipalAdmin.css';

const { TabPane } = Tabs;

const App = () => {
  return (
    <div className="app-container">
      <div className="content">
        <Tabs
          defaultActiveKey="1"
          tabPosition="bottom"
          size="large"
          animated
          className="custom-tabs"
        >
          <TabPane
            tab={<span><HomeOutlined />Principal</span>}
            key="1"
          >
            <h2>Contenido de Home</h2>
          </TabPane>
          <TabPane
            tab={<span><FormOutlined />Registrar siniestro</span>}
            key="2"
          >
            <h2>Contenido de Search</h2>
          </TabPane>
          <TabPane
            tab={<span><DashboardOutlined />Registrar kilometraje</span>}
            key="3"
          >
            <h2>Contenido de Likes</h2>
          </TabPane>
          <TabPane
            tab={<span><UserOutlined />Perfil</span>}
            key="5"
          >
            <h2>Contenido de Profile</h2>
          </TabPane>
        </Tabs>
      </div>
    </div>
  );
};

export default App;
